import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Box from "@material-ui/core/Box";
import Typography from "@material-ui/core/Typography";
import Button from "@material-ui/core/Button";
import Grid from "@material-ui/core/Grid";
import TextField from "@material-ui/core/TextField";
import Hidden from "@material-ui/core/Hidden";
import IconButton from "@material-ui/core/IconButton";
import ArrowBackIosIcon from "@material-ui/icons/ArrowBackIos";
import CancelIcon from "@material-ui/icons/Cancel";
import CloudUploadOutlinedIcon from "@material-ui/icons/CloudUploadOutlined";

import DocSideNav from "./DocSideNav";
import Navbar from "../../Components/Navbar";
import CovidAlert from "../../Components/Alert";
import Verification from "./DocProfileNoAccount";


const useStyles = makeStyles((theme) => ({
  covidBox: {
    marginTop: 64,
    [theme.breakpoints.down("sm")]: {
      marginTop: 20,
      marginLeft: 20,
      marginRight: 20,
    },
  },
}));


function DocAccountVerification(props) {
  const classes = useStyles();

  return (
    <div>
      <Navbar />
      <Hidden smDown>
        <div className={classes.covidBox} style={{ position: "relative" }}>
          <CovidAlert />

          <Grid container spacing={0}>
            <Grid item md={4} lg={3}>
              <DocSideNav />
            </Grid>

            <Grid item sm={12} md={8} lg={9}>
              <Verification />
              {/* <AccountSettings /> */}
              {/* <DocCard /> */}
            </Grid>
          </Grid>
        </div>
      </Hidden>
      <Hidden mdUp>
        <Verification />
      </Hidden>
    </div>
  );
}

export default DocAccountVerification;
